import React from "react";
import "../css_styles/Banner.css";
const Banners = () => {
  return (
    <div className="banner">
      <h2 className="banner_text">I was motivated by Your Beauty</h2>
      <h2 className="banner_author">--darklover</h2>
    </div>
  );
};

export default Banners;
